script: |
  super -f text -I q216.spq | sort > q216.out

inputs:
  - name: q216.spq
    data: |
      SELECT DISTINCT cor0.col1 * col2 + + 46 * col0 + + col1 / ( - col1 + + ( ( + col2 ) ) ) AS col1 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q216.out
    data: |
      1152
      4280
      5121
